function insertAtCursor(myField,myValue){if(document.selection){myField.focus();sel=document.selection.createRange();sel.text=myValue;}
else if(myField.selectionStart||myField.selectionStart=='0'){var startPos=myField.selectionStart;var endPos=myField.selectionEnd;myField.value=myField.value.substring(0,startPos)
+myValue
+myField.value.substring(endPos,myField.value.length);}else{myField.value+=myValue;}}
function set_dependable_fields(){var in_added_event_list=[];$(".has_depend_fld:not(.added-dpnds)").each(function(){var thisObj=$(this);var inputtype=thisObj.attr("type");var class_prefix=thisObj.data("class-prefix");var name=thisObj.attr("name");if(!class_prefix){class_prefix="fld-"+name.replace(/[\[\]\_]/g,"-").replace(/\-$/g,"");}
thisObj.addClass("added-dpnds");if(in_added_event_list.indexOf("[name="+name+"]")==-1){in_added_event_list.push("[name="+name+"]");$("[name='"+name+"']").on("change",function(e){setDependableSettings(thisObj,class_prefix);});setDependableSettings(thisObj,class_prefix);}});$(".has_depend_fld2:not(.added-dpnds)").each(function(){var thisObj=$(this);var inputtype=thisObj.attr("type");var class_prefix=thisObj.data("class-prefix");var name=thisObj.attr("name");if(!class_prefix){class_prefix="fld-"+name.replace(/[\[\]\_]/g,"-").replace(/\-$/g,"");}
thisObj.addClass("added-dpnds");if(in_added_event_list.indexOf("[name="+name+"]")==-1){in_added_event_list.push("[name="+name+"]");$("[name='"+name+"']").on("change",function(e){setDependableSettings2(thisObj,class_prefix);});setDependableSettings2(thisObj,class_prefix,true);}});}
function setDependableSettings(elem,class_prefix){try{var name=elem.attr("name");var type=elem.attr("type");if(type=="checkbox"||type=="radio"){var selectedAction=$("[name='"+name+"']:checked").val();if(selectedAction==undefined){selectedAction=$("[name='"+name+"'][type=hidden]").val();}}else{var selectedAction=$("[name='"+name+"']").val();}
if(selectedAction){selectedAction=selectedAction.toLowerCase();var hiddenFlields=$("."+class_prefix+":not(."+class_prefix+"-"+selectedAction+")");if(hiddenFlields.length>0){hiddenFlields.fadeOut('fast',function(){hiddenFlields.find("input,select,textarea").prop("disabled",true);showDependableSettings(class_prefix,selectedAction);});}else{showDependableSettings(class_prefix,selectedAction);}
elem.closest("form").find("[type=submit]").prop("disabled",false);}}catch(e){}}
