function setMultiSelect(){$(".app-multi-select:not(.ev-added)").addClass('ev-added').each(function(){var thisobj=$(this);var name=thisobj.data("name");var input=$('<input type="hidden" name="'+name+'">');thisobj.prepend(input);thisobj.find("> .apm-option").on("click",function(e){e.preventDefault();var val=$(this).data('value');input.val(val);});})}
