function setLikeDislike(){$('body').on("click",".kn-like-btn",function(e){e.preventDefault();var mainobj=$(this);if(mainobj.hasClass("kn-liked")){return;}
var id=mainobj.data("kid");if(id){CallMyAjax(base_url+"knowledge/counter/like/"+id,{},function(){console.log("called");mainobj.find("> i").addClass("app-fa-loading");},function(rdata){if(rdata.status){mainobj.addClass("kn-liked");mainobj.find("> i").removeClass("app-fa-loading");$("a.kn-dislike-btn[data-kid="+id+"]").fadeOut();$("#ld-msg-"+id).html(appGlobalLang.Liked);$(".kn-like-counter-"+id).each(function(){var counter=$(this).text();counter=parseInt(counter);counter++;$(this).text(counter);});}else{mainobj.find("> i").removeClass("app-fa-loading");}});}});$('body').on("click",".kn-dislike-btn",function(e){e.preventDefault();var mainobj=$(this);if(mainobj.hasClass("kn-disliked")){return;}
var id=mainobj.data("kid");if(id){CallMyAjax(base_url+"knowledge/counter/dislike/"+id,{},function(){console.log("called");mainobj.find("> i").addClass("app-fa-loading");},function(rdata){if(rdata.status){mainobj.addClass("kn-disliked");mainobj.find("> i").removeClass("app-fa-loading");$("a.kn-like-btn[data-kid="+id+"]").fadeOut();$("#ld-msg-"+id).html(appGlobalLang.Disliked);$(".kn-dislike-counter-"+id).each(function(){var counter=$(this).text();counter=parseInt(counter);counter++;$(this).text(counter);});}else{mainobj.find("> i").removeClass("app-fa-loading");}});}});}
