function SetOnlineUpdate(){if(appGlobalLang.is_online_check){var is_enabled=getCookie(appGlobalLang.online_cookie_name);if(is_enabled=="Y"){$.getJSON(appGlobalLang.user_online_url,function(rdata){if(rdata.status){setTimeout(SetOnlineUpdate,appGlobalLang.online_cookie_interval);}});}}}
function is_ok_noti_id(id){if(mynotifications.indexOf(id)>-1){return false;}else{mynotifications.push(id);return true;}}
function app_process_online_notification(rdata){try{for(i in addOnNewCheckerResponse){addOnNewCheckerResponse[i](rdata);}}catch(e){}
try{if(rdata.data.length>0){var isAdded=false;var isShowedNoti=false;for(var i in rdata.data){if(is_ok_noti_id(rdata.data[i].id)){isAdded=true;isShowedNoti=false;try{for(i in addOnNewnotification){var ireturn=addOnNewnotification[i](rdata.data[i]);if(!isShowedNoti&&ireturn){isShowedNoti=ireturn;}}}catch(e){}
if(!isShowedNoti){ShowGritterMsg(rdata.data[i].body,true,false,rdata.data[i].title,rdata.data[i].icon,30000);}}}
if(isAdded&&appGlobalLang.is_noti_audio){try{var audio=new Audio(appGlobalLang.noti_audio_path);audio.play();}catch(e){gcl(e);}}
if(isAdded){try{update_notificationTry();}catch(e){}}
ReloadShowNotificationAll();}}catch(e){}}
function LoadNotiDatafromCache(){var gdata=localStorage.getItem("_notilastdata");if(gdata){var nitiConfigObj=JSON.parse(gdata);if(typeof nitiConfigObj=="object"){return nitiConfigObj;}}
return null;}
function CheckOnlineNotification(){try{if(appGlobalLang.on_sec_noti&&appGlobalLang.current_user_type=="AD"){var isLoadedData=false;var lastTime=localStorage.getItem("_notilastcall");var d=new Date();var timestamp=d.getTime()-lastTime;if(timestamp+3000<appGlobalLang.on_sec_noti_interval){var rdata=LoadNotiDatafromCache();if(rdata){app_process_online_notification(rdata);isLoadedData=true;}}
if(!isLoadedData){$.getJSON(appGlobalLang.on_sec_noti_url,function(rdata){var d=new Date();localStorage.setItem("_notilastcall",d.getTime());localStorage.setItem("_notilastdata",JSON.stringify(rdata));app_process_online_notification(rdata);});}
setTimeout(CheckOnlineNotification,appGlobalLang.on_sec_noti_interval+2);}}catch(e){}}
